import time


class Solution(object):
    def shortestPalindrome(self, s):
        """
        :type s: str
        :rtype: str
        """
        t = s + "#" + s[::-1]
        p = [0 for char in t]
        i = 1
        m = len(t)
        while (i < m):
            prev = p[i - 1]
            while (prev > 0 and t[i] != t[prev]):
                prev = p[prev - 1]
            if t[i] == t[prev]:
                p[i] = prev + 1
            else:
                p[i] = prev
            i += 1
        k = p[m - 1]
        return s[:k - 1:-1] + s

    def shortestPalindrome1(self, s):
        """
        :type s: str
        :rtype: str
        """
        # start0 = time.time()
        if len(s) <= 1:
            return s
        # ls = []
        t = '#'
        for ch in s:
            t += ch + '#'
        n = len(t)
        p = [0] * (n // 2 + 1)
        center = 0
        right = 0
        print(time.time() - start)
        for i in range(n // 2 + 1):
            j = 2 * center - i
            if p[j] < right - i:
                p[i] = p[j]
            else:
                p[i] = right - i
                center = i
                while i + 1 + p[i] < n and i - 1 - p[i] >= 0 and t[i + 1 + p[i]] == t[i - 1 - p[i]]:
                    p[i] += 1
                    right += 1
        pos = n // 2
        while p[pos] != pos:
            pos -= 1
        return s[:pos - 1:-1] + s


